import React from "react"

import WebProject from "./WebProject"

import VueToDoImg from "../assets/VueToDo.png"

export default function WebProjectList() {
    return (
        <>
            <WebProject imgURL={VueToDoImg} projectTitle="VueToDo" type="Solo Project" description="VueToDo is a simple web todo list written in Vue with JavaScript." />

        </>
    )
}
